// otherwise keep it as it is.
// If the string contains no letters, reverse the string.
// The function should return the resulted string.
// Examples
// >>> solve("1234")
// "4321"
// >>> solve("ab")
// "AB"
// >>> solve("#a@C")
// "#A@c"
function solve(s){
    if(s.charAt(i) == 'a' || s.charAt(i) == 'A'){
        s = s.replace(s.charAt(i), 'A').replace(s.charAt(i), 'a');
    }
